    false,nt"url": null,nt"notes": "CONFINED_FEEDING_OPERATIONS_IDEM_IN is
    a point shapefile that contains confined feeding operation facility locations in
    Indiana, provided by personnel of Indiana Department of Environmental Management,
    Office of Land Quality (IDEM, OLQ) as of August 16, 2002 and subsequently updated
    on January 14, 2003, July 11, 2003, June 3, 2004, January 4, 2005, April 25, 2005,
    July 27, 2006, January 24, 2007, June 4, 2009, April 16, 2010, and June 25, 2013.
    The data was provided by IDEM in an ESRI geodatabase format and the feature class
    was named "CFO." The following is excerpted from the metadata provided by IDEM,
    OLQ for the source shapefile CONFINED_FEEDING_OPERATIONS: "This dataset consists
    of Confined Feeding Operations - i.e. A swine, chicken, turkey, beef or dairy agri-business
    that has large enough numbers of animals that IDEM regulates for environmental concerns,
